package strings;

import java.util.*;

public class AllAnagrams {
    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();
        int pLen = p.length(), winLast;
        if (pLen > s.length()) return result;
        Map<Character, Integer> pMap = getCharCounts(p);
        Map<Character, Integer> sMap = new HashMap<>();
        char last, prev = 0;
        for (int i = 0; i <= s.length() - pLen; i++) {
            winLast = i + pLen;
            last = s.charAt(winLast - 1);
            if (!pMap.containsKey(last)) {
                i = winLast - 1;
                sMap = new HashMap<>();
                continue;
            }
            if (sMap.isEmpty()) sMap = getCharCounts(s.substring(i, winLast));
            else {
                sMap.put(last, sMap.getOrDefault(last, 0) + 1);
                if (prev != 0 && sMap.containsKey(prev)) {
                    sMap.put(prev, sMap.get(prev) - 1);
                    if (sMap.get(prev) == 0) sMap.remove(prev);
                }
            }
            if (pMap.equals(sMap)) result.add(i);
            prev = s.charAt(i);
        }

        return result;
    }

    private static Map<Character, Integer> getCharCounts(String t) {
        Map<Character, Integer> tMap = new HashMap<>();
        for (char tc : t.toCharArray()) {
            tMap.put(tc, tMap.getOrDefault(tc, 0) + 1);
        }
        return tMap;
    }

    public static void main(String[] args) {
//        String s = "abab";
//        String p = "ab";

//        String s = "cbaebabacd";
//        String p = "abc";

        String s = "";
        String p = "";

//        String s = "acdcaeccde";
//        String p = "c";
        long startTime = System.nanoTime();
        List<Integer> anagrams = findAnagrams(s, p);
        long endTime = System.nanoTime();
        long duration = (endTime - startTime) / 1000000; //milli secs
        System.out.println(anagrams);
        System.out.println("Exec Time: " + duration);
    }
}
